
public class SwitchCase {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a=4;
		
		switch(a){
		
		
		case 1:
			System.out.println("go to 1st position");
		case 2 :
			System.out.println("go to 2nd position");
			
		case 100 :
			System.out.println("go to 100th position");
		default:
			System.out.println("number is not correct");
		}

		
		
		
	}

}
